import React from 'react';
import Logo from '../images/Logo.png'
import '../styles/NavBar.css';
class NavBar extends React.Component{

    render (){
        return (
<nav className='navbar navbar-light' id="Nav">
  <a className='navbar-brand' href="/">
  <h1 className="Logo__text"><img src={logo} className="d-inline-block align-top" id="Logo__img" alt="Logo" loading="lazy"/>Bonhomía</h1>
  </a>
    <button id="Collapse__button" className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="fixed-top">
  <div className="collapse" id="navbarToggleExternalContent">
    <div className="Collapse__font">
      <h5 class="text-white h4">Iniciar sesión usuario</h5>
      <h5 class="text-white h4">Iniciar sesión usuario administrador</h5>
    </div>
  </div>
  </div>
</nav>

        )
    }
}
export default NavBar;
